import React from 'react'
import { Link } from 'react-router-dom'

export default function PokemonsCard(props) {

  return (
    <div>
      <h3>{props.name.toUpperCase()}</h3>
      <img src={props.image} onClick alt="Img Not Found" width="150" height="150"/>
      <h3> {props.type} </h3>
    </div>
  )
}
